import React, {Component} from 'react'
import './Header.css'

class Header extends Component {
    render() {
        return (
            <div className="container">
                <ul>
                    <li style={{float : 'left'}}><input type="text"/></li>
                    <li><a href="#">Register</a></li>
                    <li><a href="#">Login</a></li>
                </ul>
            </div>
        )
    }
}

export default Header
